import { Dashboard } from './page/dashboard/dashboard.comp';
import {AddTicket} from './page/new-ticket/AddTicket.page'
import { TicketListing } from './page/ticket-listing/TicketListing.page';
import { Ticket } from './page/ticket/ticket.page';
import { Entry } from './page/entry/entry';

import {
  BrowserRouter as Router,
  Switch,
  Route,


} from 'react-router-dom';
function App() {
  return (
    <div className="App">
    <Router> 
    <Switch>
    <Route  exact path="/" >  <Entry/></Route>

     <DefaultLayout>


       <Route path="/dashboard" > 
       <Dashboard/>  
       </Route>

      <Route path="/addticket">
            <AddTicket/>
       </Route>

       <Route path="/tickets" >
          <TicketListing/>

       </Route>
       <Route path="/ticket:td">
          <Ticket/>

       </Route>



 </DefaultLayout>

   </Switch>    
  </Router>


    </div>
  );
}

export default App;
